import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './Home'
import About from './About'
import AboutPhil from './AboutPhil'

// function NavBar() {
//   return (
//     <div id="nav">
//       <ul>
//         <a href="/"><li><img id="logo" src="https://static.wixstatic.com/media/0583da_3c7416aeb2b840e488008c7b4d685178~mv2.png/v1/fill/w_407,h_112,al_c,lg_1/new%20logo.png" alt="logo" /></li></a>
//         <a href="/about"><li>About</li></a>
//         <a href="/aboutPhil"><li>About Phil</li></a>
//       </ul>
//     </div>
//   )
// }

function NavBar() {
  return (
    <div>
      <nav class="navbar navbar-expand-lg navbar-lightbg-light">
        <a class="navbar-brand" href="#">Navbar</a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div class="navbar-nav">
            <a class="nav-item nav-link active" href="#">Home <span class="sr-only">(current)</span></a>
            <a class="nav-item nav-link" href="#">Features</a>
            <a class="nav-item nav-link" href="#">Pricing</a>
            <a class="nav-item nav-link disabled" href="#">Disabled</a>
          </div>
        </div>
      </nav>
    </div>
  )
}

const date = new Date()

function Footer() {
  return (
    <div>
      <footer>
        ©ProRide Coaching {date.getFullYear()}
      </footer>
    </div>
  )
}

function App() {
  return (
    <Router>
    <NavBar />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route exact path="/about">
          <About />
        </Route>
        <Route exact path="/aboutPhil">
          <AboutPhil />
        </Route>
      </Switch>
      <Footer />
    </Router>
  );
}

export default App;
